import React from "react";

import GroupIcon0 from "../img/test-group-white.png";
import GroupIcon1 from "../img/test-group-black.png";

const GroupCard = (props) => {
    if (props.id == "0") {
        icon = GroupIcon0;
    }
    return(
                            <div class="scrollable-card group">
                                <div class="card">
                                    <a class="btn m-0 p-0" href="/group">
                                        <img src={GroupIcon1} class="card-img-top" alt="Hollywood Sign on The Hill" height="200" width="200"/>
                                        <div class="card-body">
                                            <h5 class="card-title">RPGers International</h5>
                                        </div>
                                        <div class="card-footer">
                                            <p>100 miembros</p>
                                        </div>
                                    </a>
                                </div>
                            </div>
    );
};

export default GroupCard;
